import React from "react";
import { FiMusic } from "react-icons/fi";

import { withRouter } from "react-router-dom";
import "../styles/reset.scss";
import "../styles/Signup.scss";

class Signup extends React.Component {
  constructor() {
    super();
    this.state = {};
  }
  render() {
    return (
      <>
        <div className="signup-div">
          <center>
            <div>
              <span className="signup-icon-text">
                <FiMusic className="music-icon" />
                musically
              </span>
            </div>
            <div>
              <h1 className="signup-page-heading-one">
                Sign up for free to start listening.
              </h1>
              <h3 className="signup-page-heading-secound">
                Sign up with your email address
              </h3>
            </div>
            <div class="main">
              <form>
                <div>
                  <input type="text" class="write" placeholder></input>
                  <label class="hello">Username</label>
                  <span class="enter"></span>
                </div>
              </form>
            </div>
          </center>
        </div>
      </>
    );
  }
}

export default withRouter(Signup);
